import Head from '../head/head';
import Footer from '../footer/footer';
import React from 'react';

function thankyou() {
    return (

<div>
<Head/>
<div className="thankyoupage">

<div className="cHeaderBanner"><h1>¡Gracias por preferir Oechsle.pe!</h1><span>Recibimos tu orden y estamos confirmando tu compra</span></div>

<header class="site-header" id="header">
		<h1 class="site-header__title" data-lead-id="site-header-title">¡Gracias por preferir Oechsle.pe!</h1>
	</header>

	<div class="main-content">
		<i class="fa fa-check main-content__checkmark" id="checkmark"></i>
		<p class="main-content__body" data-lead-id="main-content-body">Thanks a bunch for filling that out. It means a lot to us, just like you do! We really appreciate you giving us a moment of your time today. Thanks for being you.</p>
	</div>

            
</div>
<Footer/>  
</div>

    );
  }
  
export default thankyou;
